style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix('http://www.tumblr.com'),

url-prefix('https://www.tumblr.com') {

.selection_nipple.white,

.selection_nipple:not([class="selection_nipple white"]) {

  background-image: url("http://static.tumblr.com/blpgwiz/1fJluukeh/c.gif") !important;

  background-position: 22px -35px !important;

  width: 7px !important;

  height: 24px !important;

  margin-top: -8px !important;

  opacity: 1 !important;

  -moz-transition: 3s !important;

  -webkit-transition: 3s !important;

}

.selection_nipple.white {

  background-position: 0px 0px !important;

  width: 35px !important;

  height: 35px !important;

}

.selection_nipple.white:hover, .selection_nipple:not([class="selection_nipple white"]):hover {

  opacity: 0.0 !important;

  -moz-transition: .5s !important;

  -webkit-transition: .5s !important;

}

.selection_nipple:not([class="selection_nipple white"]) {

  border-bottom: solid 11px rgba(0,0,0,0)  !important;

}}
